import React from "react";
import { FaBeer } from 'react-icons/fa';

const Nav = () =>{
  return (
    <div className="py-5">
      <div className="w-full box-border">
        <div className="w-full flex justify-around">
          <div>
            <FaBeer/>
          </div>
          <div>logo</div>
          <div>
            <ul className="flex">
              <li className="mx-4">LATEST WORK</li>
              <li className="mx-4">BLOG</li>
              <li className="mx-4">HIRE ME</li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Nav;
